import React, { useState } from "react";
import axios from 'axios';

const Dashboard = () => {
    const [file, setFile] = useState(null);
    const [loading, setLoading] = useState(false);
    const [result, setResult] = useState(null);

    const handleFileChange = (e) => {
        setFile(e.target.files[0]);
        setResult(null); 
    };

    const handleUpload = async () => {
        if (!file) {
            alert("Bhai, pehle koi video select toh karo!");
            return;
        }

        const userID = localStorage.getItem('user_id') || 1; // Login se saved ID
        const formData = new FormData();
        formData.append('file', file);
        formData.append('user_id', userID);

        setLoading(true);
        try {
            const response = await axios.post('http://127.0.0.1:8000/api/analyze', formData);
            setResult(response.data);
        } catch (error) {
            console.error("Analysis Failed", error);
            alert("System error or backend not responding.");
        } finally {
            setLoading(false);
        }
    };

    return (
        <div style={{ padding: "40px", animation: "fadeIn 0.8s ease-in" }}>
            <div style={{ 
                maxWidth: "850px", margin: "0 auto", backgroundColor: "#1e293b", 
                padding: "40px", borderRadius: "20px", boxShadow: "0 20px 50px rgba(0,0,0,0.5)",
                border: "1px solid #334155" 
            }}>
                <h2 style={{ textAlign: "center", color: "#38bdf8", letterSpacing: "1px", marginBottom: "30px" }}>
                    üèõÔ∏è GOVERNANCE FORENSIC ENGINE
                </h2>
                
                <div style={{ 
                    border: "2px dashed #475569", padding: "40px", textAlign: "center", 
                    borderRadius: "15px", backgroundColor: "#0f172a", marginBottom: "30px"
                }}>
                    <input type="file" onChange={handleFileChange} style={{ color: "#94a3b8" }} />
                    <p style={{ marginTop: "10px", color: "#64748b" }}>Select Evidence Video (MP4/AVI)</p>
                </div>

                <button 
                    onClick={handleUpload} 
                    disabled={loading}
                    className={loading ? "pulse-animation" : ""}
                    style={styles.scanBtn(loading)}
                >
                    {loading ? "üß¨ EXTRACTING BIOMETRICS..." : "üöÄ INITIATE SCAN"}
                </button>

                {result && (
                    <div style={{ marginTop: "40px", animation: "slideUp 0.6s ease-out" }}>
                        <div style={styles.resultCard(result.verdict)}>
                            <h3 style={{color: '#94a3b8', margin: 0}}>ANALYSIS RESULT</h3>
                            <h1 style={{ margin: "10px 0", fontSize: "3.5rem" }}>{result.verdict}</h1>
                            <div style={{display: 'flex', justifyContent: 'center', gap: '20px'}}>
                                <span>Confidence: <strong>{result.confidence}%</strong></span>
                                <span>Time: <strong>{result.processing_time}s</strong></span>
                            </div>
                        </div>
                    </div>
                )}
            </div>

            <style>{`
                @keyframes fadeIn { from { opacity: 0; } to { opacity: 1; } }
                @keyframes slideUp { from { transform: translateY(20px); opacity: 0; } to { transform: translateY(0); opacity: 1; } }
                .pulse-animation { animation: pulse 1.5s infinite; }
                @keyframes pulse { 0% { box-shadow: 0 0 0 0 rgba(56, 189, 248, 0.4); } 70% { box-shadow: 0 0 0 15px rgba(56, 189, 248, 0); } 100% { box-shadow: 0 0 0 0 rgba(56, 189, 248, 0); } }
            `}</style>
        </div>
    );
};

const styles = {
    scanBtn: (loading) => ({
        width: "100%", padding: "18px", fontSize: "18px", fontWeight: "bold",
        borderRadius: "12px", border: "none", cursor: loading ? "not-allowed" : "pointer",
        backgroundColor: loading ? "#334155" : "#38bdf8", color: "#0f172a",
        transition: "0.3s"
    }),
    resultCard: (verdict) => ({
        padding: "30px", borderRadius: "15px", textAlign: "center", color: "white",
        background: verdict === "FAKE" ? "linear-gradient(135deg, #991b1b, #450a0a)" : "linear-gradient(135deg, #065f46, #064e3b)",
        border: `2px solid ${verdict === "FAKE" ? "#ef4444" : "#10b981"}`
    })
};

export default Dashboard;
